import React from "react";

const Logo = () => (
    <svg width={276} height={84} viewBox="0 0 276 84">
    <defs>
      <style>
        {
          ".a{fill:#fff;}.b{fill:#707070;font-size:22px;font-family:Poppins-Regular, Poppins;}"
        }
      </style>
    </defs>
    <rect className="a" width={276} height={84} />
    <text className="b" transform="translate(12 24)">
      <tspan x={64.554} y={23}>
        {"Dashboard"}
      </tspan>
    </text>
  </svg>
);

export default Logo;
